    if(!token) return res.json({ 'error': 'Wrong Token', 'code': 200, 'access': false  })

    const userId = jwtUtil.getUserId(token)

    try {
    
        if (userId < 0)
            return res.json({ 'error': 'Wrong Token', 'code': 200, 'access': false })
